    false,nt"url": null,nt"notes": "This monthly narrative report for Canaan
    Valley National Wildlife Refuge outlines Refuge accomplishments month by month in
    2007 from January through July. The report includes a planning section which discusses
    the master plan, management planning, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, and volunteer programs
    is given. Habitat management is also covered; subjects include wetlands, forests,
    and pest control. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, and marking and bird banding. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, trapping, and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, equipment
    replacement, and computer systems.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
